import React from "react";
import { BrowserRouter, Route ,Routers} from "react-router-dom";

import AddProduct from "./component/AddProduct";
function App() {
  return (
    <BrowserRouter>
    <Route path="/AddProduct" component={AddProduct}></Route>
    </BrowserRouter>
  );

}

export default App;
